// load the horns

window.sounds = new Array();

/* horn64 */  window.sounds[0] = new Audio("data:audio/mp3;base64,");
/* gat64 */ window.sounds[1]  = new Audio("data:audio/mp3;base64,");
/* td4w64 */ window.sounds[2]  = new Audio("data:audio/mp3;base64,");
/* dewae64 */ window.sounds[3]  = new Audio("data:audio/mp3;base64,");
/* notdewae64 */ window.sounds[4]  = new Audio("data:audio/mp3;base64,");
/* yass */  window.sounds[5] = new Audio("data:audio/mp3;base64,");
/*beeb*/ window.sounds[6]  = new Audio('data:audio/ogg;base64,');

function stopSound(number) {
    if (sounds[number]) {
        sounds[number].stop();
    }
}
function playSound(number) {

    if(sounds[number])
      sounds[number].play();
}

//Keyboard support
window.onkeydown = function(event){
	event = event || window.event;
    	var keycode = event.charCode || event.keyCode;
	   //Spacebar Horn
    	if(keycode == 32){
        	playSound(0);
    	}
    	//G key triggers Gat
    	if(keycode == 71){
    		playSound(1);
    	}
        //T key triggers TD4W
        if (keycode == 84){
            playSound(2);
        }
        //D key triggers De Wae
        if (keycode == 68){
            playSound(3);
        }
        //N key does not know De Wae
        if (keycode == 78){
            playSound(4);
        }
        //B key does Beeb
        if (keycode == 66){
            playSound(6);
        }
        //Y key does Yas
        if (keycode == 89){
            playSound(5);
        }
         
}

